import './App.css';
import Home from './pages/Home';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Search from './components/search/Search';

function App() {
  return (
    <div className="app">
      <BrowserRouter>
      <Routes>
        <Route>
        <Route path="/search" element={Search}/>
          <Route path="/" element={<Home />} />

        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
